import io
class File(io.RawIOBase):                                                        # File                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                      File                                                                                                                                                         
    def __init__(self, path, mode='r'):                                          # pylint: disable=unused-argument                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                  mode                                                                                                                                                               
        self.path = path                                                         # File                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                
        self.mode = mode                                                         # File                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                
